import React, { useContext } from 'react'
import { Property } from './App'

const Main = () => {

    const state = useContext(Property)

    return (
        <div className={`main ${state.mode ? 'bg_change':''}`}>
            <button
            onClick={state.toggle}
                className='btn_css'>
                Toggle
            </button>
        </div>
    )
}

export default Main
